  "inlineSchema": "// This is your Prisma schema file,\n// learn more about it in the docs: https://pris.ly/d/prisma-schema\n\ngenerator client {\n  provider        = \"prisma-client-js\"\n  binaryTargets   = [\"native\", \"debian-openssl-3.0.x\"]\n  previewFeatures = [\"prismaSchemaFolder\"]\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// --- MODÈLES DE SÉCURITÉ ET UTILISATEURS ---\n\nmodel User {\n  id            String         @id @default(cuid())\n  email         String         @unique\n  name          String?\n  password      String\n  roles         Role[]         @relation(\"UserRoles\")\n  refreshTokens RefreshToken[]\n  mfaSecret     String?\n  pdvId         String? // Relation vers PDV pour multi-PDV\n  pdv           PDV?           @relation(fields: [pdvId], references: [id])\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\nmodel Permission {\n  id          String  @id @default(cuid())\n  name        String  @unique // ex: \"product:create\", \"user:delete\"\n  description String?\n  roles       Role[]  @relation(\"RolePermissions\")\n}\n\nmodel Role {\n  id          String       @id @default(cuid())\n  name        String       @unique // ex: \"Administrateur\", \"Caissier\"\n  description String?\n  users       User[]       @relation(\"UserRoles\")\n  permissions Permission[] @relation(\"RolePermissions\")\n  discountCap Decimal? // Pour remises par rôle\n}\n\n// --- MODÈLES MÉTIER (PRODUITS & STOCKS) ---\n\nmodel Product {\n  id          String  @id @default(cuid())\n  name        String\n  description String?\n  sku         String  @unique // Stock Keeping Unit - code article unique\n  barcode     String? @unique // Code-barres\n  price       Float\n  cost        Float? // Prix d'achat\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  stockLevels StockLevel[]\n}\n\n// --- MODÈLES PDV ET CONFIG ---\n\nmodel PDV {\n  id       String  @id @default(cuid())\n  name     String\n  location String?\n  timezone String  @default(\"Africa/Douala\")\n  users    User[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\nmodel Config {\n  id    String @id @default(cuid())\n  key   String @unique\n  value Json\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\n// --- MODÈLES TIERS ---\n\nmodel Client {\n  id           String         @id @default(cuid())\n  name         String\n  phone        String         @unique\n  category     ClientCategory\n  discountRate Decimal        @default(0)\n  creditLimit  Decimal?\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\nenum ClientCategory {\n  GROSSISTE\n  REVENDEUR\n  DETAIL\n}\n\nmodel Supplier {\n  id           String            @id @default(cuid())\n  name         String\n  contact      String?\n  paymentTerms String?\n  invoices     SupplierInvoice[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\nmodel SupplierInvoice {\n  id            String    @id @default(cuid())\n  supplierId    String\n  supplier      Supplier  @relation(fields: [supplierId], references: [id])\n  invoiceNumber String    @unique\n  date          DateTime\n  total         Decimal\n  items         Json // Array of line items\n  dueDate       DateTime?\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\n// --- MODÈLES STOCK ---\n\nmodel StockLevel {\n  id       String @id @default(cuid())\n  quantity Int    @default(0)\n  location String // Ex: \"Magasin Yaoundé\", \"Entrepôt Douala\"\n\n  productId String\n  product   Product @relation(fields: [productId], references: [id])\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@unique([productId, location])\n}\n\nmodel StockMovement {\n  id        String       @id @default(cuid())\n  productId String\n  type      MovementType\n  quantity  Int\n  reference String?\n  createdBy String\n  createdAt DateTime     @default(now())\n}\n\nenum MovementType {\n  IN\n  OUT\n  ADJUSTMENT\n}\n\nmodel StockAlert {\n  id        String     @id @default(cuid())\n  productId String\n  level     AlertLevel\n  createdAt DateTime   @default(now())\n  handled   Boolean    @default(false)\n}\n\nenum AlertLevel {\n  THRESHOLD\n  CRITICAL\n}\n\n// --- MODÈLES POS ---\n\nmodel PosSession {\n  id             String        @id @default(cuid())\n  pdvId          String\n  cashierId      String\n  openedAt       DateTime      @default(now())\n  closedAt       DateTime?\n  openingBalance Decimal\n  closingBalance Decimal?\n  status         SessionStatus @default(OPEN)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\nenum SessionStatus {\n  OPEN\n  CLOSED\n}\n\nmodel Sale {\n  id        String    @id @default(cuid())\n  sessionId String\n  clientId  String?\n  items     Json // Array of {productId, qty, price}\n  total     Decimal\n  payments  Payment[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\nmodel Payment {\n  id        String      @id @default(cuid())\n  saleId    String\n  sale      Sale        @relation(fields: [saleId], references: [id])\n  type      PaymentType\n  amount    Decimal\n  reference String?\n\n  createdAt DateTime @default(now())\n}\n\nenum PaymentType {\n  CASH\n  MOMO\n  CARD\n}\n\n// Refresh tokens for user sessions (allow revocation)\nmodel RefreshToken {\n  id        String   @id @default(cuid())\n  // tokenHash is a SHA-256 hash of the refresh token value. We store the hash\n  // instead of the plaintext token to mitigate token leakage from the DB.\n  tokenHash String   @unique\n  userId    String\n  user      User     @relation(fields: [userId], references: [id])\n  revoked   Boolean  @default(false)\n  ip        String? // optional: IP address where token was issued\n  userAgent String? // optional: user agent for auditing\n  createdAt DateTime @default(now())\n  expiresAt DateTime\n}\n\n// Audit logs for admin actions\nmodel AuditLog {\n  id        String   @id @default(cuid())\n  actorId   String\n  action    String\n  target    String?\n  payload   Json?\n  createdAt DateTime @default(now())\n}\n",
